import React from 'react'

export default function PageOne() {
    return (
        <React.Fragment>
            <div id="page1">
                <h1>Hello CodeSandbox</h1>
                <h2>Start editing to see some magic happen!</h2>
            </div>
        </React.Fragment>
    )
}
